import React from 'react';
import ReactStoreIndicator from 'react-score-indicator'
class Tutorialscore extends React.Component{
    constructor(props){
        super(props);
        this.state=props;
        console.log(this.state)
    }
    render(){
        return(
           <div className="container1">
               <p style={{alignContent:"left"}}>{this.state.tutorial_name}</p> <ReactStoreIndicator value={this.state.user_score} maxValue={this.state.max_score} width="100" style={{alignContent:"right"}}/>
           </div>
        )
    }
}
export default Tutorialscore;
